import React, { Component } from 'react';
import './App.css';
import { Route, Switch, Redirect, withRouter } from "react-router-dom";

class App extends Component {
  render() {
    return <Fragment>
      <NavBar />
      <Switch>
        <Route exact path="/" render={() => <Redirect to="/welcome" />} />
        <Route exact path="/work" render={() => <Redirect to="/welcome" />} />
        <Route exact path="/contact" render={() => <Redirect to="/welcome" />} />
        <Route exact path="/about" render={() => <Redirect to="/welcome" />} />
      </Switch>
    </Fragment>
  }
}

export default App;
